import React,{useState} from 'react';

function HomePage() {
    const [components, setComponents] = useState<any>([]);

    const addComponent = () => {
      setComponents([...components, {}]);
    };
    return (
        // JSX content here
        <div style={{ backgroundColor: '#a4a4a4', flex: 1 }}>
        {components.map((id:any, index) => (
          <div key={index} style={{ backgroundColor: 'pink', height: 360, width: 360 }}>
            <button style={{ marginTop: 10, alignSelf: 'flex-end' }} onClick={addComponent}>
              Add another component
            </button>
          </div>
        ))}
      </div>
        );
}

export default HomePage;
